import React, { useEffect, useState } from 'react';
import { Joc } from '../types/Joc'; // Asigură-te că calea este corectă

const Jocuri: React.FC = () => {
  const [jocuri, setJocuri] = useState<Joc[]>([]);

  useEffect(() => {
    const mockData: Joc[] = [
      {
        IDJoc: 1,
        NumeLoc: 'Masa Blackjack 1',
        TipJoc: 'Blackjack',
        PariuMinim: 10,
        PariuMaxim: 500,
      },
      {
        IDJoc: 2,
        NumeLoc: 'Ruletă VIP',
        TipJoc: 'Ruletă',
        PariuMinim: 50,
        PariuMaxim: 1000,
      },
      {
        IDJoc: 3,
        NumeLoc: 'Sloturi - Lucky 7',
        TipJoc: 'Slot',
        PariuMinim: 5,
        PariuMaxim: 100,
      },
    ];

    setJocuri(mockData);
  }, []);

  return (
    <div
      className="min-h-screen bg-cover bg-center p-6"
      style={{ backgroundImage: "url('/images/background-casino.jpg')" }}
    >
      <div className="max-w-4xl mx-auto bg-black bg-opacity-70 rounded-md p-6 shadow-lg text-white">
        <h1 className="text-3xl font-bold mb-6 text-center">Jocuri disponibile</h1>
        <table className="min-w-full border border-gray-300 bg-white bg-opacity-90 text-black rounded-md overflow-hidden">
          <thead className="bg-gray-200">
            <tr>
              <th className="px-4 py-2 text-left">Nume Loc</th>
              <th className="px-4 py-2 text-left">Tip Joc</th>
              <th className="px-4 py-2 text-left">Pariu Minim</th>
              <th className="px-4 py-2 text-left">Pariu Maxim</th>
            </tr>
          </thead>
          <tbody>
            {jocuri.map((joc) => (
              <tr key={joc.IDJoc} className="border-t border-gray-300">
                <td className="px-4 py-2">{joc.NumeLoc}</td>
                <td className="px-4 py-2">{joc.TipJoc}</td>
                <td className="px-4 py-2">{joc.PariuMinim} RON</td>
                <td className="px-4 py-2">{joc.PariuMaxim} RON</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Jocuri;
